import { useState } from "react";
import { Button } from 'react-bootstrap';

export default function Register({ register, setIsLogin }) {
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [firstname, setFirstname] = useState("");
  const [lastname, setLastname] = useState("");

  const handleRegister = () => {
    register(username, password, firstname, lastname);
  };

  return (
    <form>
      <Typography variant="h5" style={{ marginBottom: 8 }}>
        Login
      </Typography>
      <label>
        Username:
        <TextField value={username} onChange={(e) => setUsername(e.target.value)} /><br/>
      </label>
        <TextField value={password} onChange={(e) => setPassword(e.target.value)} /><br/>
      
        First name:
        <TextField
          value={firstname}
          onChange={(e) => setFirstname(e.target.value)}
        />
      <label>
        Last name:
        <TextField value={lastname} onChange={(e) => setLastname(e.target.value)} /><br/>
      </label>
      <button onClick={() => handleRegister()}>register</button>
      <button onClick={() => setIsLogin(true)}>login</button>
    </form>
  );
}
